import React from "react";

function ContactPage() {
  return (
    <>

        <div class="flex justify-center items-center relative rounded-3xl overflow-hidden shadow-2xl border border-white/20 glass-effect w-[80vw]">
          <div class="absolute inset-0 bg-gradient-to-br from-white/30 via-white/10 to-white/5 opacity-40"></div>
          <div class="relative z-10 p-6 text-white w-[100%] flex flex-col ">
            <h2 className="text-center">Contact Us</h2>
            <input placeholder="Name" className="bg-transparent focus:outline-none border-[1px] border-opacity-30 border-white rounded-lg placeholder:text-lg text-lg font-light px-2 h-8 placeholder:font-light w-[80%]"/><br/>
            <input placeholder="Phone Number" className="bg-transparent focus:outline-none border-[1px] border-opacity-30 border-white rounded-lg placeholder:text-lg text-lg font-light px-2 h-8 placeholder:font-light w-[80%]"/><br />
            <input placeholder="Email" className="bg-transparent focus:outline-none border-[1px] border-opacity-30 border-white rounded-lg placeholder:text-lg text-lg font-light px-2 h-8 placeholder:font-light w-[80%]"/>
          </div>

      </div>
    </>
  );
}

export default ContactPage;
